import { useState } from "react";

const Hello = function (props) {
  const [name, setName] = useState("Mike");
  const [age, setAge] = useState(props.age);

  return (
    <div>
      <h2>
        {name}({props.age})
      </h2>
      <button onClick={() => setName(name === "Mike" ? "Jane" : "Mike")}>
        Change name
      </button>
    </div>
  );
};

export default Hello;
